def Actor = listOfValidatorResponse.getNodeValue('//*:messageProfiles[1]//*:Actor//*:keyword');
testRunner.testCase.testSuite.setPropertyValue("Actor_keyword", Actor )

def Transaction = listOfValidatorResponse.getNodeValue('//*:messageProfiles[1]//*:Transaction//*:keyword');
testRunner.testCase.testSuite.setPropertyValue("Transaction_keyword", Transaction )



//disable tests case if doesnt exist
for(testCaseCounter in (0..TotalTestCases-1)){  
